    public NtworkDetailJFrame(HarEntry entry) throws IOException {

        initComponents();
        //set same icon
        byte[] btDataFile = Base64.decodeBase64(
                ""
        );
        BufferedImage image = ImageIO.read(new ByteArrayInputStream(btDataFile));
        setIconImage(image);

        this.setTitle(entry.getRequest().getUrl());
        jRequestArea.setText(
                entry.getRequest().getMethod()
                + "\n"
                + entry.getRequest().getUrl()
                + "\nHeaders:\n"
                + entry.getRequest().getHeaders()
                + "\nDecoded Result:\n"
                + entry.getRequest().getPostData()
                + "\n"
                + entry.getRequest().getComment()
        );
        jResponseArea.setText(entry.getResponse().getHttpVersion()
                + "\nStatus: "
                + entry.getResponse().getStatus() + " " + entry.getResponse().getStatusText()
                + "\nHeaders:\n"
                + entry.getResponse().getHeaders()
                + "\nDecodedResult: "
                + entry.getResponse().getContent().getComment()
                + entry.getResponse().getContent().getEncoding()
                + entry.getResponse().getContent().getMimeType()
                + entry.getResponse().getContent().getText()
                + "\n"
                + entry.getResponse().getContent().getText());
    }

